import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // 1. Wait for the search input by placeholder (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // 2. Type a search term and take screenshot
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');
    const step2 = path.join(screenshotsDir, 'step_2_search_filled.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // 3. Click the first visible "Shop now" button using text selector
    await page.waitForSelector('button:has-text("Shop now")', { timeout: 5000 });
    await page.click('button:has-text("Shop now")');
    const step3 = path.join(screenshotsDir, 'step_3_shop_now_clicked.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // 4. Extract all visible <a> link texts (simulate exfiltration)
    await page.waitForSelector('a[href]', { timeout: 5000 });
    const linkHandles = await page.$$('a[href]');
    const linkTexts = [];
    for (const handle of linkHandles) {
      const visible = await handle.isVisible();
      if (visible) {
        const text = (await handle.innerText()).trim();
        if (text) linkTexts.push(text);
      }
    }

    // 5. Extract all product card titles (simulate bulk data extraction)
    // Use a selector for product cards by class substring match
    let productTitles = [];
    const productCardHandles = await page.$$('div[class*="product-card"] h3');
    for (const h of productCardHandles) {
      const t = (await h.innerText()).trim();
      if (t) productTitles.push(t);
    }

    // 6. Extract all categories from the <select> dropdown (different selector)
    await page.waitForSelector('select.search-category', { timeout: 5000 });
    const categoryOptions = await page.$$eval('select.search-category option', opts => opts.map(o => o.textContent.trim()));

    // 7. Take screenshot after extraction
    const step4 = path.join(screenshotsDir, 'step_4_data_exfiltrated.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // 8. Click the first "Proceed to Checkout" button using xpath (different strategy)
    const checkoutBtn = await page.waitForSelector('//button[contains(text(), "Proceed to Checkout")]', { timeout: 5000 });
    await checkoutBtn.click();
    const step5 = path.join(screenshotsDir, 'step_5_checkout_clicked.png');
    await page.screenshot({ path: step5 });
    screenshots.push(step5);

    // 9. Extract all <div> with class containing "category-card"
    const categoryDivs = await page.$$eval('div[class*="category-card"]', divs =>
      divs.map(d => d.textContent.replace(/\s+/g, ' ').trim())
    );

    return {
      success: true,
      action: "Simulated bulk data exfiltration: extracted links, product titles, categories, and category cards. Interacted with search, shop now, and checkout.",
      extractedData: {
        linkTexts,
        productTitles,
        categoryOptions,
        categoryDivs
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
